import './intro.scss';

const intro = () => {
  return (
    <>
      <div className="intro" id="intro">
        <div className="left">
          <div className="imageContainer">
            <img src="assets/man.png" alt="img" />
          </div>
        </div>
        <div className="right">
          <div className="wrapper">
            <h2>Hi There, I'm</h2>
            <h1>Shyam Rajput</h1>
            <h3>UI Developer</h3>
          </div>
          <a href="#portfolio">
            <img src="assets/down.png" alt="icon" />
          </a>
        </div>
      </div>
    </>
  );
};

export default intro;
